import { BrowserRouter, Routes } from 'react-router-dom';
import './App.css';
import Quiz from './view/pages/quiz';
import Result from './view/pages/result';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Quiz />
          <Result/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
